import React from "react";
import './style.css'
const Banners = () =>{
return(
    <div className="bannerSection">
        <div className="container-fluid">
            <div className="row">
                <div className="col">
                    <div className="box">
                        <img src={require('../../Assets/Images/banner01.jpg')} className="w-100 transition"/>
                    </div>
                </div>


            </div>
        </div>
    </div>
)
}
export default Banners;
